create table problems
(
    problem_id               varchar(50)  not null
        primary key,
    contest_id               int          null,
    contest_index            varchar(50)  null,
    problem_name             varchar(50)  null,
    problem_type             varchar(50)  null,
    problem_url              varchar(200) null,
    problem_statement_length int          null,
    difficulty_rating        int          null,
    solved_by                int          null
);

create index id
    on problems (problem_id);

